import React, { createContext, useReducer, useState } from 'react'
import { urlsReducer } from '../reducers/UrlsReducer'

export const UrlsContext = createContext(null)

const UrlsContextProvider = ({ children }) => {
  // const [urls, dispatch] = useReducer(urlsReducer, [
  //   { url: 'Kappa' },
  //   { url: 'Kippa' }
  // ])

  const [urls, setUrls] = useState([{ url: 'Kappa' }, { url: 'Kippa' }])

  return (
    <UrlsContext.Provider value={{ urls }}>{children}</UrlsContext.Provider>
  )
}

export default UrlsContextProvider
